import React from 'react';

const Summary = ({ id, user }) => {
    console.log(id, user);
    return (
        <div></div>
    );
}

const User = ({ id, page, user }) => {
    console.log(`⭐️ ${id}의 ${page} 페이지의 세부정보 ⭐️`);

    if (page === 'summary') {
        return (
            <Summary
                id={id}
                user={user}
            />
        );
    }
    else if (page === 'projects') {
        return (
            <div></div>
        );
    }
    else if (page === 'statistics') {
        return (
            <div></div>
        );
    }
    else return <div></div>;
}

export default User;
